import React, { useState } from "react";
import { useLocation } from "react-router-dom";
import "./ResumePreview.css";

const ResumePreview = () => {
  const location = useLocation();
  const { resumeData } = location.state || {};
  const [jobDescription, setJobDescription] = useState("");
  const [atsScore, setAtsScore] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  const handleJobDescriptionSubmit = async (e) => {
    e.preventDefault();
    if (!jobDescription.trim()) return;

    setIsLoading(true);
    try {
      const response = await fetch("http://localhost:3001/api/score-resume", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          resumeData,
          jobDescription,
        }),
      });

      const data = await response.json();
      setAtsScore(data);
    } catch (error) {
      console.error("Error:", error);
    } finally {
      setIsLoading(false);
    }
  };

  const renderSpellingIssues = () => {
    if (!atsScore?.details?.spellingIssues?.length) return null;

    return (
      <div className="spelling-issues">
        <h3>Spelling and Grammar Issues</h3>
        <div className="issues-list">
          {atsScore.details.spellingIssues.map((issue, index) => (
            <div key={index} className="issue-item">
              <p className="issue-message">{issue.message}</p>
              <p className="issue-context">
                Context: {issue.context}
                <span className="issue-suggestions">
                  Suggestions: {issue.suggestions.join(", ")}
                </span>
              </p>
            </div>
          ))}
        </div>
      </div>
    );
  };

  return (
    <div className="resume-preview">
      <h2>Resume Preview</h2>
      <div className="resume-content">
        <h3>{resumeData.name}</h3>
        <p>{resumeData.email}</p>
        <h4>Skills</h4>
        <p>{resumeData.skills.join(", ")}</p>
        <h4>Experience</h4>
        <p>{resumeData.experience}</p>
        <h4>Education</h4>
        <p>{resumeData.education}</p>
      </div>

      <div className="ats-section">
        <h3>ATS Score Analysis</h3>
        <form onSubmit={handleJobDescriptionSubmit}>
          <textarea
            value={jobDescription}
            onChange={(e) => setJobDescription(e.target.value)}
            placeholder="Paste the job description here..."
            rows={6}
          />
          <button type="submit" disabled={isLoading}>
            {isLoading ? "Analyzing..." : "Analyze Resume"}
          </button>
        </form>

        {atsScore && (
          <div className="score-details">
            <div className="score-summary">
              <h4>Overall Score: {atsScore.score}%</h4>
              <div className="score-breakdown">
                <p>
                  Keyword Match: {atsScore.details.keywordMatch.toFixed(1)}%
                </p>
                <p>Title Match: {atsScore.details.titleMatch.toFixed(1)}%</p>
                <p>
                  Spelling Score: {atsScore.details.spellingScore.toFixed(1)}%
                </p>
              </div>
            </div>
            {renderSpellingIssues()}
            <div className="matching-keywords">
              <h4>Matching Keywords</h4>
              <p>{atsScore.details.matchingKeywords.join(", ")}</p>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default ResumePreview;
